const PlayerMenu = () => {
  return (
    // Component
    <div className="w-100 h-100 bg-light">
      {/* Container */}
      <div className="player-border w-100 h-100">
        {/* Grid System */}
        <div className="d-flex flex-column">
          {/* Rows */}
          <div className="d-flex flex-row justify-content-between">
            {/* Left Row */}
            <div className="p-1">Player 2</div>
            {/* Right Row */}
            <div className="d-flex flex-row">
              {/* Minus Sign */}
              <div className="py-1 px-2 bg-danger rounded">-</div>
              {/* Damage Total */}
              <div className="p-1">0</div>
              {/* Plus Sign */}
              <div className="py-1 px-2 bg-success rounded">+</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PlayerMenu;
